import { 
  composeBundles,
  createUrlBundle,
  createCacheBundle,
  debugBundle
} from 'redux-bundler';

import {
  createAuthBundle
} from '@corpsmap/corpsmap-bundles';

import cache from '../utils/cache'

import routesBundle from './routes-bundle';

export default composeBundles(
  debugBundle,
  routesBundle,
  createUrlBundle(),
  createCacheBundle(cache.set),
  createAuthBundle({
    appId: '17de6a86-32a9-47fc-9fa5-e98a400111b3',
    redirectOnLogout: '/'
  })
);
